import React from 'react'
import { Link } from 'react-router-dom';

function signup() {
    function showP(){
        if(document.getElementById("cb").checked){
            document.getElementById("password").type="text";
            console.log("checked");
        }else{
            document.getElementById("password").type="password";
            console.log("not checked");
        }
    }
  return (
<div className='df justify-content-center'>
    <form className='log'>
    <div id="container">
  <h1 id='h'>Sign u</h1>
  <input id="mail" type="email" placeholder="Email Address" />
  <input id="password" type="password" placeholder="Password" />
  <div id="checkbox">
    <input onClick={showP} id="cb" type="checkbox"/>
    show password
  </div>
  <button id="bn">Sign up</button>
  <a className='fp' href="#">Forgot password?</a>
    <Link  className='fp' to="/login" >Log in</Link>
</div>
    </form>
</div>
  )
}

export default signup
